'<p>',
unistr('Bei Deaktivierung der Checkbox wird ein bereits, im Cookie, gespeicherter Wert gel\00F6scht. Die Browser-Entwicklungstools k\00F6nnen ebenfalls f\00FCr die Entfernung des Cookies verwendet werden.'),
